import React from 'react';
import { Linking, StyleSheet, View, Button} from 'react-native';

import {Dimensions} from 'react-native';

const WINDOW_HEIGHT = Dimensions.get('window').height;

export default function CreateLoraForm(){
    return(

        <View style={styles.form_container}>

            <View style={styles.button}>

                <Button title="REDIREC TO LORA UPLOAD PAGE"onPress={()=>{Linking.openURL('http://127.0.0.1:8000/diffusers_api/lora_training')}} > REDIRECT </Button>
            
            </View>

        </View>
    )

}

const styles = StyleSheet.create({
  
    form_container: {
      width: '80%',
      height: 200,
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  
    button: {
      width: '100%',
      maxWidth: WINDOW_HEIGHT-100,
      backgroundColor: 'red',
    }, 
  
  });
